import{_ as e,o as a,c as r,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 18.2-97 Larceny of certain animals and poultry.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-97.md","filePath":"vacode/18.2-97.md"}'),t={name:"vacode/18.2-97.md"},l=o('<h1 id="§-18-2-97-larceny-of-certain-animals-and-poultry" tabindex="-1">§ 18.2-97 Larceny of certain animals and poultry. <a class="header-anchor" href="#§-18-2-97-larceny-of-certain-animals-and-poultry" aria-label="Permalink to &quot;§ 18.2-97 Larceny of certain animals and poultry.&quot;">​</a></h1><p>Any person who shall be guilty of the larceny of a dog, horse, pony, mule, cow, steer, bull, or calf shall be guilty of a Class 5 felony, and any person who shall be guilty of the larceny of any poultry of the value of $5 or more, but of the value of less than $1,000, or of a sheep, lamb, swine, or goat, of the value of less than $1,000, shall be guilty of a Class 6 felony.</p><p>Code 1950, § 18.1-102; 1960, c. 358; 1962, c. 15; 1966, c. 247; 1975, cc. 14, 15; 1981, c. 197; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0764" target="_blank" rel="noreferrer">764</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0765" target="_blank" rel="noreferrer">765</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0089" target="_blank" rel="noreferrer">89</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0401" target="_blank" rel="noreferrer">401</a>.</p>',3),n=[l];function i(c,s,f,h,p,_){return a(),r("div",null,n)}const u=e(t,[["render",i]]);export{g as __pageData,u as default};
